import React from 'react';

import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Form from '../components/Form'

const Discussions = () => {
  return (
    <div>
      <Navbar />
      <Form />
    <Footer />
    </div>
  )
}

export default Discussions
